import { useEffect, FC } from 'react';
import CheckMarkIconImage from '../../images/CheckMarkIcon.png';
import styles from './ComputerDetails.module.css';
import { useAppDispatch } from '../../services/hooks/hooks';
// import { fetchOrderNumberRequest, updateOrderNumber } from '../../services/actions/orderDetails';

import { ComputerDetailsProps } from '../../services/types/types';

const ComputerDetails: FC<ComputerDetailsProps> = ({ computer, statement }) => {
    const dispatch = useAppDispatch();

    //   useEffect(() => {
    // dispatch(fetchOrderNumberRequest());
    // dispatch(updateOrderNumber(orderId));
    //   }, [dispatch, orderId]);
    console.log({ computer, statement })

    return (
        <article>
            <h2 className={`${styles.textShadows} text text_type_digits-large mb-8`} data-cy="orderNumber">
                {computer.name}
            </h2>
            <div className={styles.card}>
                {statement == "Play"
                    ?
                    <ul className={styles.cardList}>
                        <li className={styles.listItem}>
                            <p className={styles.listText}>Часов: </p>
                            <input className={styles.listInput} type="text" />
                        </li>

                        <li className={styles.listItem}>
                            <p className={styles.listText}>Минут: </p>
                            <input className={styles.listInput} type="text" />
                        </li>

                        <li className={styles.listItem}>
                            <p className={styles.listText}>Сумма: </p>
                            <input className={styles.listInput} type="text" />
                        </li>

                        <li className={styles.listItem}>
                            <button className={styles.listInputSubmit}>Принять</button>
                        </li>
                    </ul>
                    :
                    <></>
                }
            </div>
        </article>
    );
}

export default ComputerDetails;
